import '../index.css'
import React from 'react';


export const Navbar = () =>{

    return(
        <div className='navbar'>

      <Link to='/contact'>Kontakt</Link>
      <Link to='/'>Home</Link>
            <button>Menu</button>
            <button>Contact</button>
            <button>More</button>
        </div>
    )
}
